{
  "presets": [
    [
      "@babel/preset-env",
      {
        "modules": false,
        "bugfixes": true
      }
    ]
  ],
  "env": {
    "test": {
      "presets": [
        [
          "@babel/preset-env",
          {
            "bugfixes": true,
            "targets": {
              "browsers": "node >=10"
            }
          }
        ]
      ],
      "plugins": ["dynamic-import-node"]
    },
    "esm": {
      "presets": [
        [
          "@babel/preset-env",
          {
            "modules": false,
            "bugfixes": true,
            "targets": {
              "esmodules": true
            }
          }
        ]
      ]
    }
  }
}

export default {
  testEnvironment: "jsdom",
  moduleNameMapper: {
    "single-spa": "<rootDir>/src/single-spa.js",
  },
  globals: {
    __SINGLE_SPA_DEVTOOLS__: {},
    __DEV__: true,
    __PROFILE__: true,
  },
};

export default {
  testEnvironment: "node",
  moduleNameMapper: {
    "single-spa": "<rootDir>/src/single-spa.js",
  },
  testRegex: "node-spec/.+.(spec|test).js",
  globals: {
    __SINGLE_SPA_DEVTOOLS__: {},
    __DEV__: true,
    __PROFILE__: true,
  },
};

